Aplicativo oficial do canal BOTECO F1.

Mantenha-se atualizado e bem informado sobre o esporte a motor mais respeitado de todos os tempos.
Além de poder disputar e brincar com a gente no game Pitacos, com o aplicativo do BOTECO F1 você terá de modo fácil e rápido às seguintes funcionalidades:

- Notícias sobre o mundo da F1 através de cobertura independente;
- Acesso a todos os vídeos do canal BOTECO F1;
- Calendário com todas as informações da temporada;
- Resultados das Classificações;
- Resultados dos Grandes Prêmios;
- Classificação do campeonato de construtores;
- Classificação do campeonato de pilotos;
- Notificações com lembrete de eventos (treinos livres, classificação e grande prêmio);
